import React from "react";
import styled from "styled-components";

const Paths = ({ player }) => {
  return (
    <Canvas>
      <Image src={player.src} alt={`${player.name} 플레이어`} />
    </Canvas>
  );
};

export default Paths;

const Canvas = styled.canvas``;

const Image = styled.image`
  width: 3rem;
  height: 3rem;
`;
